import React from "react";
import '../App.css'
import { Link } from 'react-router-dom'
import { FaSearch, FaInfoCircle, FaSignInAlt } from 'react-icons/fa';

class Navigation extends React.Component {
  render() {
    return (
      <nav className="flex jcsb bgGrass absolute vw100" style={{padding: "15px"}}>
          <Link className="nav" to='/search'><FaSearch/></Link>
          <Link className="nav" to='/about'><FaInfoCircle/></Link>
          <Link className="nav" to='/firebaselogin'><FaSignInAlt/></Link>
      </nav>
    );
  }
}


export default Navigation;
